import React from "react";

const PostSubmit = () => {
  return (
    <div className="card p-1">
      <textarea className="form-control" />
      <div className="text-right mt-1">
        <button className="btn btn-primary">TalkIt</button>
      </div>
    </div>
  );
};

export default PostSubmit;
